// HasApplication applies the HasEdge predicate on the "application" edge.
func HasApplication() predicate.OrganizationApplication {
	return predicate.OrganizationApplication(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ApplicationTable, ApplicationColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasApplicationWith applies the HasEdge predicate on the "application" edge with a given conditions (other predicates).
func HasApplicationWith(preds ...predicate.Application) predicate.OrganizationApplication {
	return predicate.OrganizationApplication(func(s *sql.Selector) {
		step := newApplicationStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.OrganizationApplication) predicate.OrganizationApplication {
	return predicate.OrganizationApplication(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.OrganizationApplication) predicate.OrganizationApplication {
	return predicate.OrganizationApplication(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.OrganizationApplication) predicate.OrganizationApplication {
	return predicate.OrganizationApplication(sql.NotPredicates(p))
}
